import React from 'react';
import {
    GalleryContainer,
    Card,
    Image,
    Title
} from './styles'

type Props = {
    images: string[]
}

export const Gallery = ({ images } : Props ) => {
    return (
        <GalleryContainer>
          {images.map((image, index) => (
            <Card key={index}>
              <Image src={image.src} alt={image.alt} />
              <Title>{image.title}</Title>
            </Card>
          ))}
        </GalleryContainer>
      );
    };
